const QUALITY = require('./QUALITY');

const GEAR_PRICE = {
    [QUALITY.ROOKIE]: [
        1800,
        10800,
        54000,
        270000,
    ],
    [QUALITY.INTERMEDIATE]: [
        600,
        3600,
        18000,
        90000,
    ],
    [QUALITY.VETERAN]: [
        200,
        1200,
        6000,
        30000,
    ],
    [QUALITY.MASTER]: [
        200,
        1200,
        6000,
        30000,
    ],
};

module.exports = GEAR_PRICE;
